import "./Navbar.css";

function Navbar() {
  return (
    <>
      <div className="navbar">
        <h2 className="navbarTitle">Navigate to</h2>
        <div className="navbarList">
          <li>1</li>
          <li>2</li>
          <li>3</li>
        </div>
      </div>
    </>
  );
}

export default Navbar;
